import React from "react";

const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  return (
    <div className="rating">
      for (let i in ratings)
      {
        <span>
          <i
            className={
              value - i >= 1
                ? "fas fa-start"
                : value - i >= 0.5
                ? "fas fa-star-half-alt"
                : "far fa-star"
            }
          ></i>
        </span>
      }
    </div>
  );
};

export default Rating;
